import React, {
  useRef,
  forwardRef,
  useImperativeHandle,
  useEffect,
  useCallback,
  useState,
} from 'react';
import { View, AppState, Text, StyleSheet } from 'react-native';
import type { ViewStyle, DimensionValue } from 'react-native';
import WebView from 'react-native-webview';
import type { Lottie } from './types';

export const LottiePlayer = forwardRef(
  (
    {
      lottie,
      bg_color,
      width,
    }: {
      lottie: Lottie;
      bg_color?: string;
      width?: DimensionValue | undefined;
    },
    parentRef
  ) => {
    const [isStopped, setIsStopped] = useState(false);
    const webViewRef = useRef<WebView>(null);

    const pause = useCallback(() => {
      if (lottie) {
        const script = `
        if (typeof anim !== 'undefined' && anim !== null) {
          anim.pause();
        }
        if (typeof audioObject !== 'undefined' && audioObject !== null) {
          audioObject.pause();
        }
        true;
      `;
        webViewRef.current?.injectJavaScript(script);
      }
    }, [lottie]);

    const play = useCallback(() => {
      if (lottie) {
        setIsStopped(false); // Set isStopped to false when play is called
        const script = `
        if (typeof anim !== 'undefined' && anim !== null) {
          anim.play();
        }
        if (typeof audioObject !== 'undefined' && audioObject !== null) {
          audioObject.play();
        }
        true;
      `;
        webViewRef.current?.injectJavaScript(script);
      }
    }, [lottie]);

    const stop = useCallback(() => {
      if (lottie) {
        setIsStopped(true); // Set isStopped to true when stop is called
        const script = `
        if (typeof anim !== 'undefined' && anim !== null) {
          anim.goToAndStop(0, true);
        }
        if (typeof audioObject !== 'undefined' && audioObject !== null) {
          audioObject.pause();
          audioObject.currentTime = 0;
        }
        true;
      `;
        webViewRef.current?.injectJavaScript(script);
      }
    }, [lottie]);

    useImperativeHandle(parentRef, () => ({
      pause,
      play,
      stop,
    }));

    useEffect(() => {
      if (Object.keys(lottie).length === 0) {
        return;
      }
      play();
      const handleAppStateChange = (nextAppState: string) => {
        if (nextAppState !== 'active') {
          pause();
        } else {
          play();
        }
      };

      const subscription = AppState.addEventListener(
        'change',
        handleAppStateChange
      );

      return () => {
        subscription.remove();
      };
    }, [lottie, pause, play]);

    if (Object.keys(lottie).length === 0) {
      return (
        <View style={styles.unavailable}>
          <Text style={styles.unavaliableText}> Story unavailable</Text>
        </View>
      );
    }

    const webViewStyle: ViewStyle = {
      width: width || '100%', // Defaults to '100%' if width is not provided
      alignSelf: width ? 'center' : 'stretch', // Defaults to 'stretch' if width is not provided
    };
    return (
      <View style={styles.web}>
        <WebView
          style={webViewStyle}
          ref={webViewRef}
          originWhitelist={['*']}
          javaScriptEnabled={true}
          domStorageEnabled={true}
          scalesPageToFit={true}
          scrollEnabled={false}
          source={{
            html: `
<html>
<head>
    <style>
    @font-face {
        font-family: 'Moderat';
        font-weight: bold;
        src: url(data:application/font-woff;charset=utf-8;base64,) format('woff');
    }

    @font-face {
        font-family: 'Moderat';
        font-weight: normal;
        src: url(data:application/font-woff;charset=utf-8;base64,) format('woff');
    }
    body, html {margin: 0; padding: 0; overflow: hidden; background-color: ${bg_color};}
    </style>
</head>
<body>
    <div style="font-family: Moderat; font-weight: bold; width: 100%; height: 0px; visibility: hidden;">Font Init</div>
    <div style="font-family: Moderat; font-weight: normal; width: 100%; height: 0px; visibility: hidden;">Font Init</div>
    <div id="animation"></div>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/bodymovin/5.8.1/lottie.min.js"></script>
    <script>
    var audioObject;
    var anim;
    function createAudio(assetPath) {
      var audioElement = new Audio(assetPath);
      audioObject = {
          play: function(){
              this.isPlaying = true;
              audioElement.play()
          },
          pause: function(){
              this.isPlaying = false;
              audioElement.pause();
          },
          seek: function(){this.isPlaying = false},
          playing: function(){},
          rate: function(){},
          volume: function(v){
              if(v!=null) audioElement.volume = v;
              return audioElement.volume;
          },
      }
      return audioObject;
  }
    const animationData = ${JSON.stringify(lottie)};
    const container = document.getElementById('animation');
    anim = lottie.loadAnimation({
        renderer: 'svg',
        container: container,
        autoplay: true,
        loop: false,
        animationData: animationData,
        audioFactory: createAudio
    });
    </script>
</body>
</html>
`,
            baseUrl: '',
          }}
        />
        {isStopped && <View style={styles.stop} />}
      </View>
    );
  }
);

const styles = StyleSheet.create({
  unavailable: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#2f2f2f',
  },
  unavaliableText: {
    color: 'white',
    fontSize: 16,
  },
  stop: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0, 0, 0, 0.5)', // Dark overlay
  },
  web: {
    position: 'relative',
    flex: 1,
  },
});

export default LottiePlayer;
